String getTypeOfId(long id) {
  if (isNodeIdExist(id)) {
    return NODE_TYPE;
  } else if (isNodeRefIdExist(id)) {
    return REF_TYPE;
  } else {
    return UNKNOWN_TYPE;
  }
}
